import TripStoryItem from "./TripStoryItem";

const TripStoryList = () => {
    return (
        <div className={styles["main-wrapper"]}>
            <p className={styles["trip-story-list-title"]}>Ïã§ÏãúÍ∞Ñ Ïó¨ÌñâÍ∏∞üê§</p>
            <p className={styles["trip-story-list-sub-title"]}>
                ÏßÅÏ†ë Îã§ÎÖÄÏò® Ï∂îÏ≤ú ÏùºÏ†ïÍ≥º Ïó¨Ìñâ ÍøÄÌåÅ ÌôïÏù∏ÌïòÍ∏∞
            </p>

            <div className={styles["items-wrapper"]}>
